    super()
      this.state = {
        spells: [],
        error: ''
      }
  }
  render() {
    return (
      <main className='App' style={{ backgroundImage: `url(${background})`}}>
        <h1 className='app-title'>Kittens To Witches</h1>
        <SpellInspirations />
      </main>
    );
  }
}

